import React from 'react';

import VegasBg from './assets/images/vegas.png';

import TimerComp from './components/TimerComp';

function App() {
  return (
    <div className="h-screen bg-black">
      <div className="h-full"
        style={{
          backgroundImage: "url(" + VegasBg + ")",
          backgroundPosition: 'bottom',
          backgroundSize: 'auto',
          backgroundRepeat: 'no-repeat',
        }}>
          <div
            className="h-full"
            >
            <div className="py-8 h-full flex flex-col justify-between  absolute t-1/2">
              <div className="flex flex-col items-center space-y-12 md:mt-36 md:space-y-24">
                <span className="text-white font-bold text-lg tracking-3xl text-center">
                  CINEMACON
                </span>

                <div>
                  <TimerComp />
                </div>
              </div>
            </div>

          </div>
        </div>
    </div>
  );
}

export default App;
